import { useState } from "react";
import axios from "axios";
import { toast } from "react-toastify";
import {
    CircularProgress,
    Button,
    Typography,
    Container,
    Box,
    Card,
    CardContent,
    Grid
} from "@mui/material";

const API_URL =
    process.env.NODE_ENV === "development"
        ? "http://localhost:5000"
        : process.env.REACT_APP_API_URL || "http://app:5000";

const UploadForm = () => {
    const [realEstateFile, setRealEstateFile] = useState(null);
    const [techFile, setTechFile] = useState(null);
    const [loading, setLoading] = useState(false);
    const [finalResult, setFinalResult] = useState(null);

    const handleFileChange = (event, type) => {
        if (type === "real_estate") setRealEstateFile(event.target.files[0]);
        if (type === "tech") setTechFile(event.target.files[0]);
    };

    const uploadFile = async (file, type) => {
        if (!file) {
            toast.error(`–í—ã–±–µ—Ä–∏—Ç–µ —Ñ–∞–π–ª –¥–ª—è ${type === "real_estate" ? "–Ω–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç–∏" : "—Ç–µ—Ö–Ω–∏–∫–∏"}!`);
            return null;
        }

        const formData = new FormData();
        formData.append("file", file);
        formData.append("type", type);

        try {
            const response = await axios.post(`${API_URL}/predict/`, formData, {
                headers: { "Content-Type": "multipart/form-data" },
            });

            return response.data;
        } catch (error) {
            toast.error(`–û—à–∏–±–∫–∞ –∑–∞–≥—Ä—É–∑–∫–∏ ${type}: ${error.message}`);
            return null;
        }
    };

    const handleUpload = async () => {
        setLoading(true);

        const realEstateResult = await uploadFile(realEstateFile, "real_estate");
        const techResult = await uploadFile(techFile, "tech");

        if (realEstateResult && techResult) {
            setFinalResult({
                realEstate: realEstateResult,
                tech: techResult
            });
            toast.success("–§–∞–π–ª—ã —É—Å–ø–µ—à–Ω–æ –æ–±—Ä–∞–±–æ—Ç–∞–Ω—ã!");
        }

        setLoading(false);
    };

    return (
        <Container maxWidth="md">
            <Box textAlign="center" mt={4} p={3} boxShadow={3} borderRadius={2}>
                <Typography variant="h5" gutterBottom>–ó–∞–≥—Ä—É–∑–∫–∞ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–π</Typography>

                {/* –ü–æ–ª—è –¥–ª—è –∑–∞–≥—Ä—É–∑–∫–∏ */}
                <Typography variant="body1">üè° –ü—Ä–∏–∫—Ä–µ–ø–∏—Ç–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ –Ω–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç–∏:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "real_estate")} />

                <Typography variant="body1" style={{ marginTop: "10px" }}>üì± –ü—Ä–∏–∫—Ä–µ–ø–∏—Ç–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ —Ç–µ—Ö–Ω–∏–∫–∏:</Typography>
                <input type="file" onChange={(e) => handleFileChange(e, "tech")} />

                <Box mt={2}>
                    <Button variant="contained" color="primary" onClick={handleUpload} disabled={loading}>
                        {loading ? <CircularProgress size={24} color="inherit" /> : "–ó–∞–≥—Ä—É–∑–∏—Ç—å"}
                    </Button>
                </Box>

                {/* –í—ã–≤–æ–¥ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–æ–≤ –≤ –∫–∞—Ä—Ç–æ—á–∫–∞—Ö */}
                {finalResult && (
                    <Grid container spacing={2} mt={3}>
                        {/* –ö–∞—Ä—Ç–æ—á–∫–∞ –Ω–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç–∏ */}
                        <Grid item xs={12} md={6}>
                            <Card variant="outlined">
                                <CardContent>
                                    <Typography variant="h6">üè° –ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å</Typography>
                                    <Typography variant="body1"><b>–§–∞–π–ª:</b> {finalResult.realEstate.file}</Typography>
                                    <Typography variant="body1"><b>–ö–ª–∞—Å—Å:</b> {finalResult.realEstate.final_class}</Typography>
                                    <Typography variant="body1"><b>–£–≤–µ—Ä–µ–Ω–Ω–æ—Å—Ç—å:</b> {finalResult.realEstate.final_confidence}%</Typography>
                                    <Typography variant="body2" color="textSecondary">–ò—Å—Ç–æ—á–Ω–∏–∫: YOLO + TensorFlow</Typography>
                                </CardContent>
                            </Card>
                        </Grid>

                        {/* –ö–∞—Ä—Ç–æ—á–∫–∞ —Ç–µ—Ö–Ω–∏–∫–∏ */}
                        <Grid item xs={12} md={6}>
                            <Card variant="outlined">
                                <CardContent>
                                    <Typography variant="h6">üì± –¢–µ—Ö–Ω–∏–∫–∞</Typography>
                                    <Typography variant="body1"><b>–§–∞–π–ª:</b> {finalResult.tech.file}</Typography>
                                    <Typography variant="body1"><b>–ö–ª–∞—Å—Å:</b> {finalResult.tech.final_class}</Typography>
                                    <Typography variant="body1"><b>–£–≤–µ—Ä–µ–Ω–Ω–æ—Å—Ç—å:</b> {finalResult.tech.final_confidence}%</Typography>
                                    <Typography variant="body2" color="textSecondary">–ò—Å—Ç–æ—á–Ω–∏–∫: CLIP</Typography>
                                </CardContent>
                            </Card>
                        </Grid>
                    </Grid>
                )}
            </Box>
        </Container>
    );
};

export default UploadForm;
